import React from 'react';
import { Switch } from 'react-router-dom';


export default function Header() {
    return (
        <header>
            <div className='logo-container'>
                <img src='https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG' alt='AC Milan Logo' className='logo-img' />
                <span className='logo-text'>AC Milan</span>
                <ul className='nav'>
                    <li><Switch to="/history">Про клуб</Switch></li>
                    <li><Switch to="/old_team">Основна команда</Switch></li> {/* Додаємо посилання для Основної команди */}
                    <li><Switch to="/new_team">Молодіжна команда</Switch></li> {/* Додаємо посилання для Молодіжної команди */}
                </ul>
            </div>
            <div className='presentation'></div>
        </header>
    )
}
